<!DOCTYPE html>
<script>
function Class0() {}
function isClass0(o) {
  return o instanceof Class0;
}

function Class1(s) {this.s = s;}
Class1.prototype.getValue = function(){return this.s;};
function isClass1(o) {
  return o instanceof Class1;
}

var my = {};
my.package = {};
my.package.Class2 = function(){};
function isClass2(o) {
  return o instanceof my.package.Class2;
}
</script>
